      async function loadRoles() {
  console.log(chalk.gray('â”‚  â†³ Checking role databases...'));

  const roleFiles = [
    './allrole/ownPanel.json',
    './allrole/ownerasli.json',
    './allrole/ceouser.json',
    './allrole/tkuser.json',
    './allrole/ptuser.json',
    './allrole/reseller.json',
    './users.json'
  ];

  let success = 0;

  for (const file of roleFiles) {
    try {
      const filePath = path.join(__dirname, file);

      if (!fs.existsSync(filePath)) {
        fs.writeFileSync(filePath, JSON.stringify([], null, 2));
        console.log(chalk.red(`â”‚  âš  ${file} tidak ditemukan, dibuat otomatis`));
      }

      const data = JSON.parse(fs.readFileSync(filePath, 'utf-8'));

      if (!Array.isArray(data)) {
        throw new Error('Format harus ARRAY');
      }

      console.log(chalk.gray(`â”‚  âœ” ${file} loaded (${data.length} user)`));
      success++;
    } catch (err) {
      console.log(chalk.red(`â”‚  âœ– ${file} error: ${err.message}`));
    }
  }

  console.log(chalk.gray(`â”‚  âœ… Roles loaded: ${success}/${roleFiles.length}`));
  console.log(chalk.gray('â•°â”€ Step 3 completed\n'));
}

