const CPU_LIMIT = 80
async function getServers(panel) {
  const { data } = await axios.get(
    `${panel.domain}/api/application/servers`,
    {
      headers: {
        Authorization: `Bearer ${panel.plta}`,
        Accept: "application/json"
      }
    }
  )
  return data.data
}

async function getCpuUsage(panel, uuid) {
  const { data } = await axios.get(
    `${panel.domain}/api/client/servers/${uuid}/resources`,
    {
      headers: {
        Authorization: `Bearer ${panel.pltc}`,
        Accept: "application/json"
      }
    }
  )
  return data.attributes.resources.cpu_absolute
}

async function stopServer(panel, uuid) {
  await axios.post(
    `${panel.domain}/api/client/servers/${uuid}/power`,
    { signal: "stop" },
    {
      headers: {
        Authorization: `Bearer ${panel.pltc}`,
        Accept: "application/json",
        "Content-Type": "application/json"
      }
    }
  )
}
async function autoCheckCpu(panel) {
  const servers = await getServers(panel)
  let stopped = []

  for (const s of servers) {
    const cpu = await getCpuUsage(panel, s.attributes.uuid)

    if (cpu >= CPU_LIMIT) {
      await stopServer(panel, s.attributes.uuid)
      stopped.push({
        name: s.attributes.name,
        id: s.attributes.id,
        cpu: cpu
      })
    }
  }

  return {
    total: servers.length,
    stopped
  }
}

