const parseDuration = (input) => {
  const match = input.match(/^(\d+)([smhdby])$/i);
  if (!match) return null;
  const value = parseInt(match[1]);
  const unit = match[2].toLowerCase();
  
  const unitToMs = {
    s: 1000,
    m: 60 * 1000,
    h: 60 * 60 * 1000,
    d: 24 * 60 * 60 * 1000,
    b: 30 * 24 * 60 * 60 * 1000, // bulan
    y: 365 * 24 * 60 * 60 * 1000 // tahun
  };

  return value * (unitToMs[unit] || 0);
};

function getWaktu() {
  const now = new Date();

  const hariArr = [
    "Minggu",
    "Senin",
    "Selasa",
    "Rabu",
    "Kamis",
    "Jumat",
    "Sabtu"
  ];

  const bulanArr = [
    "Januari",
    "Februari",
    "Maret",
    "April",
    "Mei",
    "Juni",
    "Juli",
    "Agustus",
    "September",
    "Oktober",
    "November",
    "Desember"
  ];

  const hari = hariArr[now.getDay()];
  const tanggal = `${now.getDate()} ${bulanArr[now.getMonth()]} ${now.getFullYear()}`;
  const jam = now.toLocaleTimeString("id-ID", {
    hour: "2-digit",
    minute: "2-digit",
    second: "2-digit",
    timeZone: "Asia/Jakarta"
  });

  return { hari, tanggal, jam };
}
function cekCooldownPanel(userId) {
  const now = Date.now();

  if (panelCooldown[userId]) {
    const sisa = PANEL_COOLDOWN_TIME - (now - panelCooldown[userId]);

    if (sisa > 0) {
      return {
        boleh: false,
        sisaDetik: Math.ceil(sisa / 1000)
      };
    }
  }

  // set cooldown baru
  panelCooldown[userId] = now;
  return { boleh: true };
}

