function generateSaran(errorMsg) {
  const msg = errorMsg.toLowerCase();

  if (msg.includes("missing ) after argument list")) {
    return "Periksa tanda kurung `()` pada pemanggilan function atau parameter yang belum ditutup.";
  }

  if (msg.includes("unexpected token")) {
    return "Cek adanya karakter tidak valid, kurung berlebih, atau kesalahan penulisan sintaks.";
  }

  if (msg.includes("undefined")) {
    return "Pastikan variabel atau function sudah dideklarasikan sebelum digunakan.";
  }

  if (msg.includes("not a function")) {
    return "Pastikan variabel yang dipanggil memang bertipe function dan tidak tertimpa nilai lain.";
  }

  if (msg.includes("cannot read property") || msg.includes("cannot read properties")) {
    return "Kemungkinan objek bernilai `undefined` atau `null`. Tambahkan pengecekan sebelum diakses.";
  }

  if (msg.includes("assignment to constant variable")) {
    return "Variabel `const` tidak bisa diubah. Gunakan `let` jika nilainya perlu diperbarui.";
  }

  if (msg.includes("await is only valid")) {
    return "Gunakan `await` hanya di dalam function `async`.";
  }

  if (msg.includes("module not found")) {
    return "Pastikan module sudah terinstall dan path import/require sudah benar.";
  }

  if (msg.includes("syntaxerror")) {
    return "Periksa struktur kode JavaScript, kemungkinan ada kurung, koma, atau tanda kutip yang salah.";
  }

  // fallback (kalau error aneh)
  return "Periksa log error lengkap di console untuk mengetahui penyebab pastinya.";
}

