bot.onText(/\/getfitur (.+)/, async (msg, match) => {
    const chatId = msg.chat.id
    const fitur = match[1].trim()

    const fs = require('fs')
    const path = require('path')
    const filePath = path.join(__dirname, 'bot.js')

    if (!fitur) {
        return bot.sendMessage(chatId, 'âŒ Nama fitur kosong')
    }

    try {
        const data = fs.readFileSync(filePath, 'utf8')

        // ambil 1 block bot.onText berdasarkan command
        const regex = new RegExp(
            `bot\\.onText\\(\\/\\\\?${fitur}[^\\)]*\\)[\\s\\S]*?\\n\\}\\)`,
            'm'
        )

        const result = data.match(regex)

        if (!result) {
            return bot.sendMessage(chatId, `âŒ Fitur "${fitur}" tidak ditemukan`)
        }

        const kode = result[0]

        // kirim preview teks
        await bot.sendMessage(chatId,
`ðŸ“„ *FITUR:* /${fitur}

\`\`\`js
${kode.slice(0, 350)}${kode.length > 350 ? '\n...' : ''}
\`\`\``,
        { parse_mode: 'Markdown' })

        // kirim sebagai file txt
        await bot.sendDocument(chatId, Buffer.from(kode), {
            filename: `${fitur}.txt`,
            contentType: 'text/plain'
        })

    } catch (err) {
        bot.sendMessage(chatId, 'âŒ Error:\n' + err.message)
    }
})
