bot.onText(/^\/tomp3(?:\s+(.+))?$/i, async (msg) => {
  const chatId = msg.chat.id;

  // Cek apakah ada reply video atau voice note
  const reply = msg.reply_to_message;
  if (!reply || (!reply.video && !reply.audio && !reply.voice)) {
    return await bot.sendMessage(
      chatId,
      "âŒ Format salah!\n\nContoh penggunaan:\n/tomp3 (reply video, voice note, atau audio)"
    );
  }

  try {
    await bot.sendMessage(chatId, "â³ Sedang mengkonversi ke MP3...");

    let fileId;
    if (reply.video) fileId = reply.video.file_id;
    else if (reply.audio) fileId = reply.audio.file_id;
    else if (reply.voice) fileId = reply.voice.file_id;

    // Ambil file info & download
    const file = await bot.getFile(fileId);
    const fileUrl = `https://api.telegram.org/file/bot${BOT_TOKEN}/${file.file_path}`;

    const res = await fetch(fileUrl);
    const buffer = Buffer.from(await res.arrayBuffer());
    const tempInput = `./temp/input_${msg.message_id}`;
    const tempOutput = `./temp/output_${msg.message_id}.mp3`;
    const fs = require("fs");

    // Simpan sementara
    fs.writeFileSync(tempInput, buffer);

    // Konversi ke mp3 pakai ffmpeg
    const ffmpeg = require("fluent-ffmpeg");
    await new Promise((resolve, reject) => {
      ffmpeg(tempInput)
        .format("mp3")
        .on("error", reject)
        .on("end", resolve)
        .save(tempOutput);
    });

    // Kirim hasil
    await bot.sendAudio(chatId, tempOutput, {
      caption: "âœ… Konversi ke MP3 berhasil!",
    });

    // Hapus file sementara
    fs.unlinkSync(tempInput);
    fs.unlinkSync(tempOutput);

  } catch (err) {
    console.error("TOMP3 ERROR:", err);
    await bot.sendMessage(chatId, "âŒ Terjadi kesalahan saat konversi ke MP3.");
  }
});

