bot.onText(/^\/sharegrupmsg$/, async (msg) => {
  const chatId = msg.chat.id;
  const senderId = String(msg.from.id);

  // Cek akses (aksesjasher.json)
  const allowedUsers = fs.existsSync("aksesjasher.json") 
    ? JSON.parse(fs.readFileSync("aksesjasher.json")) 
    : [];
  if (!allowedUsers.includes(senderId)) {
    return bot.sendMessage(chatId, "ðŸš« Kamu tidak punya akses untuk menggunakan perintah ini.");
  }

  const reply = msg.reply_to_message;
  if (!reply) {
    return bot.sendMessage(chatId, "âŒ Reply pesan yang ingin dibagikan ke grup.");
  }

  // Load grup dari idgrup.json
  let grups = [];
  if (fs.existsSync("idgrup.json")) {
    grups = JSON.parse(fs.readFileSync("idgrup.json"));
  }

  if (!grups.length) {
    return bot.sendMessage(chatId, "âš ï¸ Tidak ada grup untuk dibagikan.");
  }

  const loadingMsg = await bot.sendMessage(chatId, `â³ Mengirim pesan ke ${grups.length} grup...`);

  let success = 0;
  let failed = 0;

  for (const idGrup of grups) {
    try {
      await bot.forwardMessage(idGrup, chatId, reply.message_id);
      success++;
    } catch (e) {
      console.error(`Gagal kirim ke grup ${idGrup}:`, e.message);
      failed++;
    }
  }

  await bot.deleteMessage(chatId, loadingMsg.message_id);

  await bot.sendMessage(chatId, `âœ… Pesan berhasil diteruskan ke grup!\nðŸŸ¢ Berhasil: ${success}\nðŸ”´ Gagal: ${failed}`);
});

bot.onText(/^\/sharemsg(?:\s+(.+))?/, async (msg, match) => {
  const fs = require("fs");
  const chatId = msg.chat.id;
  const userId = msg.from.id.toString();
  const username = msg.from.username ? `@${msg.from.username}` : msg.from.first_name;

  // ===== PATH FILE =====
  const pathUsers = "./users.json";
  const pathAkses = "./allrole/aksesjasher.json";
  const pathOwner = "./allrole/ownerasli.json";

  // ===== CHECK ACCESS =====
  const hasAccess = () => {
    let akses = [];
    if (fs.existsSync(pathAkses)) akses = JSON.parse(fs.readFileSync(pathAkses, "utf-8"));
    let owner = [];
    if (fs.existsSync(pathOwner)) owner = JSON.parse(fs.readFileSync(pathOwner, "utf-8"));
    return akses.includes(userId) || owner.includes(userId);
  };

  if (!hasAccess()) return bot.sendMessage(chatId, "âŒ Kamu tidak punya akses untuk menggunakan fitur ini.");

  // ===== AMBIL PESAN =====
  let content = match[1];
  const options = {};

  if (msg.reply_to_message) {
    if (msg.reply_to_message.text) content = msg.reply_to_message.text;
    else if (msg.reply_to_message.photo) {
      options.photo = msg.reply_to_message.photo[msg.reply_to_message.photo.length - 1].file_id;
      if (msg.reply_to_message.caption) content = msg.reply_to_message.caption;
    } else if (msg.reply_to_message.video) {
      options.video = msg.reply_to_message.video.file_id;
      if (msg.reply_to_message.caption) content = msg.reply_to_message.caption;
    } else return bot.sendMessage(chatId, "âŒ Tipe pesan tidak didukung.");
  }

  if (!content && !options.photo && !options.video) {
    return bot.sendMessage(chatId, "âŒ Harap reply pesan atau tulis teks untuk di-share.");
  }

  // ===== BACA DAFTAR USER =====
  if (!fs.existsSync(pathUsers)) return bot.sendMessage(chatId, "âŒ Tidak ada user terdaftar.");
  const users = JSON.parse(fs.readFileSync(pathUsers, "utf-8"));

  if (users.length === 0) return bot.sendMessage(chatId, "âŒ Tidak ada user untuk diteruskan.");

  // ===== FORMAT PESAN =====
  const sharedText = `ðŸ‘¤ Shared by: ${username} (ID: ${userId})\n\n${content}`;

  // ===== PROGRESS =====
  const progressMsg = await bot.sendMessage(chatId, `ðŸ“¡ Memproses sharemsg ke 0/${users.length} user...`);

  let success = 0;
  let fail = 0;

  for (let i = 0; i < users.length; i++) {
    const uid = users[i];
    try {
      if (options.photo) await bot.sendPhoto(uid, options.photo, { caption: sharedText, parse_mode: "Markdown" });
      else if (options.video) await bot.sendPhoto(uid, options.video, { caption: sharedText, parse_mode: "Markdown" });
      else await bot.sendMessage(uid, sharedText, { parse_mode: "Markdown" });
      success++;
    } catch (err) {
      fail++;
      console.error(`Gagal kirim ke ${uid}: ${err.message}`);
    }

    // update progress setiap 5 user
    if (i % 5 === 0 || i === users.length - 1) {
      await bot.editMessageText(`ðŸ“¡ Memproses sharemsg ke ${i + 1}/${users.length} user...`, {
        chat_id: chatId,
        message_id: progressMsg.message_id
      });
    }
  }

  // ===== FINAL =====
  await bot.editMessageText(
    `âœ… Pesan berhasil diteruskan ke seluruh user!\nðŸŸ¢ Berhasil: ${success}\nðŸ”´ Gagal: ${fail}`,
    { chat_id: chatId, message_id: progressMsg.message_id }
  );
});

