bot.onText(/^\/addakses\s+(\d+)$/i, async (msg, match) => {
  const fs = require("fs");
  const pathAkses = "./allrole/aksesjasher.json";
  const chatId = msg.chat.id;
  const userId = msg.from.id;

  try {
    // Baca list akses
    let akses = [];
    if (fs.existsSync(pathAkses)) akses = JSON.parse(fs.readFileSync(pathAkses, "utf-8"));

    const newId = match[1].toString();

    if (akses.includes(newId)) {
      return bot.sendMessage(chatId, `âŒ ID ${newId} sudah ada di akses.`);
    }

    akses.push(newId);
    fs.writeFileSync(pathAkses, JSON.stringify(akses, null, 2));

    bot.sendMessage(chatId, `âœ… ID ${newId} berhasil ditambahkan ke akses.`);
  } catch (err) {
    console.error("[ADD AKSES ERROR]", err);
    bot.sendMessage(chatId, "âŒ Terjadi kesalahan saat menambahkan akses.");
  }
});

