bot.onText(/^\/delakses\s+(\d+)$/i, async (msg, match) => {
  const fs = require("fs");
  const pathAkses = "./allrole/aksesjasher.json";
  const chatId = msg.chat.id;
  const userId = msg.from.id;

  try {
    if (!fs.existsSync(pathAkses)) {
      return bot.sendMessage(chatId, "âŒ File akses tidak ditemukan.");
    }

    let akses = JSON.parse(fs.readFileSync(pathAkses, "utf-8"));
    const delId = match[1].toString();

    if (!akses.includes(delId)) {
      return bot.sendMessage(chatId, `âŒ ID ${delId} tidak ada di akses.`);
    }

    akses = akses.filter(id => id !== delId);
    fs.writeFileSync(pathAkses, JSON.stringify(akses, null, 2));

    bot.sendMessage(chatId, `âœ… ID ${delId} berhasil dihapus dari akses.`);
  } catch (err) {
    console.error("[DEL AKSES ERROR]", err);
    bot.sendMessage(chatId, "âŒ Terjadi kesalahan saat menghapus akses.");
  }
});

