bot.on('callback_query', async (query) => {
  const chatId = query.message.chat.id;
  const msgId = query.message.message_id;

  if (!query.data.startsWith('tofigure')) return;
  const [, version, randomId] = query.data.split('|');

  const rawGithubUrl = tofigureStore[randomId];
  if (!rawGithubUrl) return bot.sendMessage(chatId, "âš ï¸ URL tidak ditemukan atau sudah kedaluwarsa.");

  let api;
  if (version === 'v1') api = `https://api-faa.my.id/faa/tofigura?url=${encodeURIComponent(rawGithubUrl)}`;
  else if (version === 'v2') api = `https://api-faa.my.id/faa/tofigurav2?url=${encodeURIComponent(rawGithubUrl)}`;
  else if (version === 'v3') api = `https://api-faa.my.id/faa/tofigurav3?url=${encodeURIComponent(rawGithubUrl)}`;

  const loading = await bot.sendMessage(chatId, `ðŸŒ€ Memproses Tofigure ${version.toUpperCase()}...`);

  try {
    const res = await axios.get(api, { responseType: "arraybuffer", timeout: 60000 });
    await bot.sendPhoto(chatId, Buffer.from(res.data), { caption: `âœ¨ Tofigure ${version.toUpperCase()} berhasil!` });
    await bot.deleteMessage(chatId, loading.message_id);

    // optional hapus tombol
    try { await bot.editMessageReplyMarkup({ inline_keyboard: [] }, { chat_id: chatId, message_id: msgId }); } 
    catch (err) { console.error(err); }

    // hapus dari memory
    delete tofigureStore[randomId];
  } catch (e) {
    console.error(e);
    await bot.sendMessage(chatId, "âš ï¸ Terjadi kesalahan saat memproses Tofigure.");
  }
});


