const ytCache = new Map();

bot.onText(/^\/ytsearch(?:\s+(.+))?/, async (msg, match) => {
  const chatId = msg.chat.id;
  const query = match[1];

  if (!query) return bot.sendMessage(chatId, "Masukkan judul video yang mau dicari!");

  bot.sendMessage(chatId, "ðŸ” Sedang mencari...");
  try {
    const res = await axios.get(`https://restapi-v2.simplebot.my.id/search/youtube?q=${encodeURIComponent(query)}`);
    const result = res.data.result;

    if (!result || !result.length) return bot.sendMessage(chatId, "âŒ Tidak ditemukan hasil video.");

    ytCache.set(chatId, { result, index: 0 });
    return sendResult(chatId);
  } catch (err) {
    console.error(err);
    bot.sendMessage(chatId, "âŒ Gagal mencari video.");
  }
});

bot.on("callback_query", async (query) => {
  const chatId = query.message.chat.id;
  const data = query.data;

  if (data.startsWith("ytmp3 ")) {
    const url = data.split(" ")[1];
    bot.answerCallbackQuery(query.id, { text: "Downloading MP3..." });
    try {
      const res = await axios.get(`https://api.kenshiro.cfd/api/downloader/yta?url=${encodeURIComponent(url)}`);
      const dataRes = res.data.data;
      bot.sendAudio(chatId, dataRes.downloadLink, {
        caption: `ðŸŽµ ${dataRes.title}\nðŸ’¾ ${dataRes.size}`,
        filename: `${dataRes.title}.mp3`
      });
    } catch (e) {
      console.error(e);
      bot.sendMessage(chatId, "âŒ Gagal mengunduh MP3.");
    }
  }

  if (data.startsWith("ytmp4 ")) {
    const url = data.split(" ")[1];
    bot.answerCallbackQuery(query.id, { text: "Downloading MP4..." });
    try {
      const res = await axios.get(`https://api.kenshiro.cfd/api/downloader/ytv?url=${encodeURIComponent(url)}`);
      const dataRes = res.data.data;
      bot.sendVideo(chatId, dataRes.downloadLink, {
        caption: `ðŸŽ¬ ${dataRes.title}\nðŸ’¾ ${dataRes.size}`,
        filename: `${dataRes.title}.mp4`
      });
    } catch (e) {
      console.error(e);
      bot.sendMessage(chatId, "âŒ Gagal mengunduh MP4.");
    }
  }

  if (data === "ytnext") {
    const cache = ytCache.get(chatId);
    if (!cache) return bot.answerCallbackQuery(query.id, { text: "Data expired!" });

    cache.index = (cache.index + 1) % cache.result.length;
    ytCache.set(chatId, cache);
    bot.answerCallbackQuery(query.id);
    return sendResult(chatId, true, query.message.message_id);
  }
});

async function sendResult(chatId, edit = false, messageId = null) {
  const { result, index } = ytCache.get(chatId);
  const video = result[index];

  const caption = `ðŸŽ¬ *${video.title}*\nðŸ“º ${video.channel}\nðŸ•’ ${video.duration}\nðŸ”— [Tonton di YouTube](${video.link})`;
  const options = {
    parse_mode: "Markdown",
    reply_markup: {
      inline_keyboard: [
        [
          { text: "ðŸŽ§ MP3", callback_data: `ytmp3 ${video.link}` },
          { text: "ðŸ“¹ MP4", callback_data: `ytmp4 ${video.link}` }
        ],
        [{ text: "âž¡ï¸ Next", callback_data: "ytnext" }]
      ]
    }
  };

  if (edit && messageId) {
    try {
      await bot.editMessageMedia(
        {
          type: "photo",
          media: video.imageUrl,
          caption,
          parse_mode: "Markdown"
        },
        {
          chat_id: chatId,
          message_id: messageId,
          reply_markup: options.reply_markup
        }
      );
    } catch (e) {
      bot.sendPhoto(chatId, video.imageUrl, options);
    }
  } else {
    bot.sendPhoto(chatId, video.imageUrl, options);
  }
}

