bot.on("callback_query", async (q) => {
  try {
    if (!q.data.startsWith("pin_")) return;

    const [action, chatId, idxStr] = q.data.split("|");
    const messageId = q.message.message_id;

    const data = global.pinData?.[messageId];
    if (!data)
      return bot.answerCallbackQuery(q.id, { text: "âš ï¸ Data sudah kadaluarsa." });

    let index = parseInt(idxStr);

    // Navigasi
    if (action === "pin_next") index = (index + 1) % data.results.length;
    if (action === "pin_prev") index = (index - 1 + data.results.length) % data.results.length;

    const item = data.results[index];

    const inlineKeyboard = {
      inline_keyboard: [
        [
          { text: "â¬…ï¸", callback_data: `pin_prev|${chatId}|${index}` },
          { text: `${index + 1}/${data.results.length}`, callback_data: "noop" },
          { text: "âž¡ï¸", callback_data: `pin_next|${chatId}|${index}` },
        ],
      ],
    };

    // Ubah media
    await bot.editMessageMedia(
      {
        type: "photo",
        media: item.imageUrl,
      },
      {
        chat_id: chatId,
        message_id: messageId,
        reply_markup: inlineKeyboard,
      }
    );

    data.index = index;
    bot.answerCallbackQuery(q.id);

  } catch (err) {
    console.error("âŒ Callback Error:", err.message);
    bot.answerCallbackQuery(q.id, { text: "âš ï¸ Gagal memuat gambar." });
  }
});
