bot.on("callback_query", (q) => {
  const data = q.data
  if (!data.startsWith("tembak_")) return

  const [action, fromId, targetUsername] = data.split("|")
  const clickerId = q.from.id.toString()
  const clickerUsername = `@${q.from.username || q.from.first_name}`
  const chatId = q.message.chat.id

  const key = `${chatId}_${fromId}_${targetUsername}`
  const pending = pendingTembak[key]

  // bukan target
  if (clickerUsername !== targetUsername) {
    return bot.answerCallbackQuery(q.id, {
      text: "âŒ Bukan kamu yg ditembak, geer amat!",
      show_alert: true
    })
  }

  if (!pending) {
    return bot.answerCallbackQuery(q.id, {
      text: "â±ï¸ Sudah kadaluarsa.",
      show_alert: true
    })
  }

  clearTimeout(pending.timeout)
  delete pendingTembak[key]

  if (action === "tembak_reject") {
    bot.editMessageText(
      `ðŸ’” *DITOLAK*\n\n${targetUsername} menolak ${pending.fromUsername}.`,
      {
        chat_id: chatId,
        message_id: q.message.message_id,
        parse_mode: "Markdown"
      }
    )
    return bot.answerCallbackQuery(q.id, { text: "Kamu menolak." })
  }

  // TERIMA
  const db = loadDB()

  db[fromId] = {
    username: pending.fromUsername,
    pacar: {
      id: clickerId,
      username: clickerUsername
    },
    sejak: nowISO()
  }

  db[clickerId] = {
    username: clickerUsername,
    pacar: {
      id: fromId,
      username: pending.fromUsername
    },
    sejak: nowISO()
  }

  saveDB(db)

  bot.editMessageText(
`ðŸŽ‰ *RESMI JADIAN!*

${pending.fromUsername} â¤ï¸ ${clickerUsername}

ðŸ“… Sejak: ${nowISO()}`,
    {
      chat_id: chatId,
      message_id: q.message.message_id,
      parse_mode: "Markdown"
    }
  )

  bot.answerCallbackQuery(q.id, { text: "ðŸ’– Kamu menerima!" })
})
