bot.onText(/\/brat (.+)/, async (msg, match) => {
  const chatId = msg.chat.id;
  const text = match[1];

  if (!text) {
    return bot.sendMessage(chatId, "Contoh penggunaan: /brat teksnya");
  }

  try {
    // API untuk menghasilkan sticker brat
    const url = "https://kepolu-brat.hf.space/brat?q=" + encodeURIComponent(text);
    const tempFile = "./brat_sticker.webp";

    // Download helper
    const download = async (link, saveTo) => {
      const writer = fs.createWriteStream(saveTo);
      const response = await axios({
        url: link,
        method: "GET",
        responseType: "stream"
      });

      response.data.pipe(writer);

      return new Promise((resolve, reject) => {
        writer.on("finish", resolve);
        writer.on("error", reject);
      });
    };

    await download(url, tempFile);

    // Kirim sticker
    await bot.sendSticker(chatId, tempFile);

    // Hapus file temp
    await fs.promises.unlink(tempFile);

  } catch (err) {
    console.error(err);
    bot.sendMessage(chatId, "Error membuat stiker. Coba lagi nanti.");
  }
});

