// â”€â”€â”€ Command delete users offline â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
bot.onText(/^\/delusroff$/, async (msg) => {
  const chatId = msg.chat.id;
  const userId = msg.from.id.toString();

  if (!isMainOwner(userId)) {
    return bot.sendMessage(chatId, "âŒ Hanya main owner yang bisa menggunakan command ini!", {
      reply_to_message_id: msg.message_id
    });
  }

  const processingMsg = await bot.sendMessage(chatId, "â³ Mencari user offline tanpa server...");

  try {
    let page = 1;
    let totalPages = 1;
    const usersToDelete = [];
    const successDeletes = [];
    const failedDeletes = [];

    do {
      const res = await fetch(`${domain}/api/application/users?page=${page}`, {
        headers: {
          Accept: "application/json",
          Authorization: `Bearer ${plta}`,
        },
      });
      const json = await res.json();
      if (!json.data) break;

      totalPages = json.meta.pagination.total_pages;

      for (let user of json.data) {
        const u = user.attributes;
        if (u.root_admin || u.id === 1) continue;

        try {
          const serverRes = await fetch(`${domain}/api/application/users/${u.id}?include=servers`, {
            headers: { Accept: "application/json", Authorization: `Bearer ${plta}` },
          });
          const serverData = await serverRes.json();
          const servers = serverData.attributes.relationships?.servers?.data || [];

          if (servers.length === 0) {
            usersToDelete.push({ id: u.id, username: u.username, email: u.email });
          }
        } catch (err) {
          console.error(`Error cek server user ${u.id}:`, err.message);
        }
      }

      page++;
    } while (page <= totalPages);

    if (usersToDelete.length === 0) {
      return bot.editMessageText("âœ… Tidak ada user offline tanpa server yang ditemukan.", {
        chat_id: chatId,
        message_id: processingMsg.message_id,
      });
    }

    // â”€â”€â”€ Hapus semua user offline â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    for (let user of usersToDelete) {
      try {
        const delRes = await fetch(`${domain}/api/application/users/${user.id}`, {
          method: "DELETE",
          headers: { Accept: "application/json", Authorization: `Bearer ${plta}` },
        });
        if (delRes.status === 204) successDeletes.push(`âœ… ${user.username} (${user.email})`);
        else failedDeletes.push(`âŒ ${user.username} (${user.email})`);
      } catch (err) {
        console.error(`Gagal hapus user ${user.id}:`, err.message);
        failedDeletes.push(`âŒ ${user.username} (${user.email})`);
      }
    }

    // â”€â”€â”€ Laporan hasil delete â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
    let report = `ðŸ—‘ï¸ *LAPORAN PENGHAPUSAN USER OFFLINE*\n\n`;
    report += `ðŸ“Š Total user tanpa server: ${usersToDelete.length}\n`;
    report += `âœ… Berhasil dihapus: ${successDeletes.length}\n`;
    report += `âŒ Gagal dihapus: ${failedDeletes.length}\n\n`;
    report += `ðŸ›¡ï¸ *Admin panel dan ID 1 dilindungi*\n\n`;

    if (successDeletes.length > 0) {
      report += `*BERHASIL DIHAPUS:*\n${successDeletes.slice(0, 15).join('\n')}`;
      if (successDeletes.length > 15) report += `\n... dan ${successDeletes.length - 15} lainnya`;
    }

    await bot.editMessageText(report, {
      chat_id: chatId,
      message_id: processingMsg.message_id,
      parse_mode: "Markdown"
    });

  } catch (error) {
    console.error(error);
    await bot.editMessageText("âŒ Terjadi kesalahan saat memproses /delusroff.", {
      chat_id: chatId,
      message_id: processingMsg.message_id,
    });
  }
});

