function inRole(userId, file) {
  if (!fs.existsSync(file)) return false;
  const data = JSON.parse(fs.readFileSync(file, 'utf8'));
  return data.includes(String(userId));
}

function hasServerAccess(userId, accessFiles = []) {
  return accessFiles.some(file => inRole(userId, file));
}
