bot.on('callback_query', async (q) => {
  if (!q.data.startsWith('cp_select_')) return;

  const [, , srvId, username, targetId] = q.data.split('_');
  const server = panelServers[srvId];
  const userId = q.from.id;

  // âŒ CEK AKSES
  if (!hasServerAccess(userId, server.access)) {
    return bot.answerCallbackQuery(q.id, {
      text: "âŒ Kamu tidak punya akses ke server ini",
      show_alert: true
    });
  }

  // âœ… LANJUT PILIH RAM
  const ramButtons = Object.keys(serverConfigs).map(r => [
    { text: r.toUpperCase(), callback_data: `cp_ram_${srvId}_${r}_${username}_${targetId}` }
  ]);

  bot.editMessageText(
    `<b>${server.name}</b>\n\nðŸ’¾ Silahkan pilih RAM`,
    {
      chat_id: q.message.chat.id,
      message_id: q.message.message_id,
      parse_mode: "HTML",
      reply_markup: { inline_keyboard: ramButtons }
    }
  );
});
