bot.onText(/^\/donasi (\d+)$/i, async (msg, match) => {
  const chatId = msg.chat.id
  const from = msg.from
  const amount = parseInt(match[1])

  if (amount < 1000) {
    return bot.sendMessage(chatId, "âŒ Minimal Donasi Rp1.000")
  }

  if (!saurus.slug || !saurus.apipakasir) {
    return bot.sendMessage(chatId, "âŒ Pakasir belum dikonfigurasi")
  }

  const sessionId = Date.now().toString()

  try {
    const payload = {
      project: saurus.slug,
      order_id: sessionId,
      amount: amount,
      api_key: saurus.apipakasir
    }

    const res = await axios.post(
      "https://app.pakasir.com/api/transactioncreate/qris",
      payload,
      { headers: { "Content-Type": "application/json" } }
    )

    if (!res.data || !res.data.payment) {
      return bot.sendMessage(chatId, "âŒ Gagal membuat transaksi")
    }

    const qrText = res.data.payment.payment_number
    const qrFile = path.join(depositPath, `qris_${sessionId}.png`)
    await QRCode.toFile(qrFile, qrText, { scale: 10 })

    const sessionData = {
      sessionId,
      userId: from.id,
      username: from.username || "-",
      name: from.first_name || "-",
      amount,
      chatId,
      chatType: msg.chat.type,
      groupName: msg.chat.title || "Private",
      status: "pending",
      createdAt: Date.now()
    }

    fs.writeFileSync(
      path.join(depositPath, `pakasir_${sessionId}.json`),
      JSON.stringify(sessionData, null, 2)
    )

    const caption =
`ðŸ¤ *Donasi PANEL*

ðŸ‘¤ Nama: ${sessionData.name}
ðŸ†” ID: ${sessionId}
ðŸ’° Jumlah: Rp${amount.toLocaleString("id-ID")}
ðŸ“ Tempat: ${msg.chat.type === "private" ? "Private Chat" : sessionData.groupName}

â³ Berlaku 5 menit
Scan QRIS di atas untuk membayar`

    await bot.sendPhoto(chatId, fs.readFileSync(qrFile), {
      caption,
      parse_mode: "Markdown",
      reply_markup: {
        inline_keyboard: [
          [{ text: "âŒ Batalkan", callback_data: `cancel_donasi:${sessionId}` }]
        ]
      }
    })

  } catch (e) {
    console.error("donasi ERROR:", e.response?.data || e.message)
    bot.sendMessage(chatId, "âŒ Error membuat transaksi (API)")
  }
})
bot.on("callback_query", async (q) => {
  if (!q.data.startsWith("cancel_donasi:")) return;

  const sessionId = q.data.split(":")[1];
  const filePath = path.join(depositPath, `pakasir_${sessionId}.json`);

  if (!fs.existsSync(filePath)) return;

  const data = JSON.parse(fs.readFileSync(filePath));
  if (data.status !== "pending") return;

  try {
    await axios.post(
      "https://app.pakasir.com/api/transactioncancel",
      {
        project: saurus.slug,
        order_id: sessionId,
        amount: data.amount,
        api_key: saurus.apipakasir
      },
      {
        headers: { "Content-Type": "application/json" }
      }
    );
  } catch (e) {
    console.log("Gagal cancel ke Pakasir:", e.message);
  }

  // update status
  data.status = "canceled";
  fs.writeFileSync(filePath, JSON.stringify(data, null, 2));

  // hapus pesan lama
  await bot.deleteMessage(q.message.chat.id, q.message.message_id)
    .catch(() => {});

  // kirim pesan baru
  await bot.sendMessage(
    q.message.chat.id,
    "âŒ **Transaksi dibatalkan**",
    { parse_mode: "Markdown" }
  );

  // wajib answer callback biar ga loading
  bot.answerCallbackQuery(q.id);
});

const SALDO_PATH = "./data/saldo.json";

function loadSaldo() {
  if (!fs.existsSync(SALDO_PATH)) {
    fs.writeFileSync(SALDO_PATH, JSON.stringify({}, null, 2));
  }
  return JSON.parse(fs.readFileSync(SALDO_PATH));
}

function saveSaldo(data) {
  fs.writeFileSync(SALDO_PATH, JSON.stringify(data, null, 2));
}

function addSaldo(userId, amount) {
  const saldo = loadSaldo();
  if (!saldo[userId]) saldo[userId] = 0;
  saldo[userId] += amount;
  saveSaldo(saldo);
}

function getSaldo(userId) {
  const saldo = loadSaldo();
  return saldo[userId] || 0;
}
