bot.on("callback_query", async (q) => {
  if (!q.data.startsWith("cancel_deposit:")) return;

  const orderId = q.data.split(":")[1];
  const filePath = path.join(depositPath, `pakasir_${orderId}.json`);
  if (!fs.existsSync(filePath)) return;

  const data = JSON.parse(fs.readFileSync(filePath));
  if (data.status !== "pending") return;

  try {
    await axios.post(
      "https://app.pakasir.com/api/transactioncancel",
      {
        project: saurus.slug,
        order_id: orderId,
        amount: data.amount,
        api_key: saurus.apipakasir
      },
      { headers: { "Content-Type": "application/json" } }
    );
  } catch {}

  data.status = "canceled";
  fs.writeFileSync(filePath, JSON.stringify(data, null, 2));

  await bot.deleteMessage(q.message.chat.id, q.message.message_id).catch(() => {});
  await bot.sendMessage(q.message.chat.id, "âŒ Deposit dibatalkan.");

  bot.answerCallbackQuery(q.id);
});

const kataKasarFile = path.join(__dirname, "./data/katakasar.json")

// helper baca json
function readKataKasar() {
  if (!fs.existsSync(kataKasarFile)) {
    fs.writeFileSync(
      kataKasarFile,
      JSON.stringify({ active: false, words: [] }, null, 2)
    )
  }
  return JSON.parse(fs.readFileSync(kataKasarFile))
}

// helper simpan json
function saveKataKasar(data) {
  fs.writeFileSync(kataKasarFile, JSON.stringify(data, null, 2))
}

/* ================= ADD KATA KASAR ================= */
bot.onText(/^\/addkatakasar (.+)/i, async (msg, match) => {
  const chatId = msg.chat.id
  const kata = match[1].toLowerCase().trim()

  if (!kata) {
    return bot.sendMessage(chatId, "âŒ Format salah!\nContoh:\n/addkatakasar anjing")
  }

  const data = readKataKasar()

  if (data.words.includes(kata)) {
    return bot.sendMessage(chatId, `âš ï¸ Kata *${kata}* sudah ada.` , { parse_mode: "Markdown" })
  }

  data.words.push(kata)
  saveKataKasar(data)

  bot.sendMessage(
    chatId,
    `âœ… *Berhasil menambahkan kata kasar*\n\nðŸ“ Kata: *${kata}*\nðŸ“¦ Total: ${data.words.length}`,
    { parse_mode: "Markdown" }
  )
})

/* ================= DELETE KATA KASAR ================= */
bot.onText(/^\/delkatakasar (.+)/i, async (msg, match) => {
  const chatId = msg.chat.id
  const kata = match[1].toLowerCase().trim()

  if (!kata) {
    return bot.sendMessage(chatId, "âŒ Format salah!\nContoh:\n/delkatakasar anjing")
  }

  const data = readKataKasar()

  if (!data.words.includes(kata)) {
    return bot.sendMessage(chatId, `âŒ Kata *${kata}* tidak ditemukan.` , { parse_mode: "Markdown" })
  }

  data.words = data.words.filter(w => w !== kata)
  saveKataKasar(data)

  bot.sendMessage(
    chatId,
    `ðŸ—‘ï¸ *Kata berhasil dihapus*\n\nðŸ“ Kata: *${kata}*\nðŸ“¦ Sisa: ${data.words.length}`,
    { parse_mode: "Markdown" }
  )
})
