bot.onText(/^\/delsrvoff$/, async (msg) => {
  const chatId = msg.chat.id;
  const userId = String(msg.from.id);
  await sendLoadingSticker(bot, chatId)

  const fs = require("fs");
  const fetch = require("node-fetch");

  // ===== LOAD ROLE =====
  const ownerAsli = JSON.parse(fs.readFileSync(ownerAsliFile));

  const isAllowed =
    ownerAsli.includes(userId);

  if (!isAllowed) {
    return bot.sendMessage(
      chatId,
      `<blockquote>âŒ Perintah ini hanya untuk Owner / CEO / Tangan Kanan.</blockquote>`,
      { parse_mode: "HTML" }
    );
  }

  // ===== INFO MULAI =====
  await bot.sendMessage(
    chatId,
    `<blockquote>â³ <b>Memulai penghapusan server OFFLINE...</b></blockquote>`,
    { parse_mode: "HTML" }
  );

  try {
    let deleted = 0;
    let failed = 0;
    let list = "";

    // ===== AMBIL LIST SERVER =====
    const res = await fetch(`${domain}/api/application/servers?page=1`, {
      headers: {
        "Authorization": `Bearer ${plta}`,
        "Accept": "application/json"
      }
    });

    const json = await res.json();
    const servers = json.data || [];

    for (const srv of servers) {
      const s = srv.attributes;

      // ===== CEK STATUS =====
      const r = await fetch(
        `${domain}/api/client/servers/${s.uuid.split("-")[0]}/resources`,
        {
          headers: {
            "Authorization": `Bearer ${pltc}`,
            "Accept": "application/json"
          }
        }
      );

      const d = await r.json();
      const status = d?.attributes?.current_state || `${teleadmin}`;

      if (status !== "offline") continue;

      // ===== HAPUS SERVER =====
      const del = await fetch(
        `${domain}/api/application/servers/${s.id}`,
        {
          method: "DELETE",
          headers: {
            "Authorization": `Bearer ${plta}`,
            "Accept": "application/json"
          }
        }
      );

      if (del.ok) {
        deleted++;
        list += `ðŸ—‘ï¸ ${s.name} (ID ${s.id})\n`;
      } else {
        failed++;
      }
    }

    // ===== HASIL =====
    await bot.sendMessage(
      chatId,
      `<blockquote>
ðŸ§¹ <b>Pembersihan Selesai</b>

âœ… Terhapus : <b>${deleted}</b>
âŒ Gagal   : <b>${failed}</b>

<b>Detail:</b>
<pre>${list || "Tidak ada server offline"}</pre>
</blockquote>`,
      { parse_mode: "HTML" }
    );

  } catch (err) {
    console.error(err);
    bot.sendMessage(
      chatId,
      `<blockquote>âš ï¸ Terjadi kesalahan saat menghapus server.</blockquote>`,
      { parse_mode: "HTML" }
    );
  }
});
