const SUIT_PATH = "./data/suit.json";
/* =====================
   LOAD & SAVE
====================== */
function loadSuit() {
  if (!fs.existsSync(SUIT_PATH)) {
    fs.writeFileSync(
      SUIT_PATH,
      JSON.stringify({ stats: {}, games: {} }, null, 2)
    );
  }
  return JSON.parse(fs.readFileSync(SUIT_PATH));
}

function saveSuit(data) {
  fs.writeFileSync(SUIT_PATH, JSON.stringify(data, null, 2));
}

/* ======================
   LOGIC SUIT
====================== */
function hasilSuit(a, b) {
  if (a === b) return "seri";
  if (
    (a === "batu" && b === "gunting") ||
    (a === "gunting" && b === "kertas") ||
    (a === "kertas" && b === "batu")
  ) return "menang";
  return "kalah";
}

/* ======================
   CEK BISA PM ATAU TIDAK
====================== */
async function canPM(bot, userId) {
  try {
    await bot.sendMessage(userId, "ðŸ”„ Checking...", {
      disable_notification: true
    });
    return true;
  } catch {
    return false;
  }
}

