bot.onText(/^\/(ubahpw|changepassword)(?:\s+(.+))?/, async (msg, match) => {
    const chatId = msg.chat.id;
    const raw = match[2];

    // Validasi format
    if (!raw || !raw.includes('|')) {
        return bot.sendMessage(
            chatId,
            'â€¢ Format: /ubahpw IP|PasswordLama|PasswordBaru',
            { parse_mode: 'Markdown' }
        );
    }

    const [ip, oldPw, newPw] = raw.split('|').map(x => x.trim());
    if (!ip || !oldPw || !newPw) {
        return bot.sendMessage(chatId, 'IP, Password Lama, dan Password Baru wajib diisi!');
    }

    const connOpt = {
        host: ip,
        port: 22,
        username: 'root',
        password: oldPw
    };

    // Loading message
    const waitMsg = await bot.sendMessage(chatId, 'ðŸ”Œ Menghubungkan ke VPSâ€¦');

    // Mulai SSH
    const conn = new Client();

    conn.on('ready', () => {
        conn.exec(`echo 'root:${newPw}' | chpasswd`, (err, stream) => {
            if (err) {
                bot.editMessageText(
                    `âŒ Gagal ubah password: ${err.message}`,
                    { chat_id: chatId, message_id: waitMsg.message_id }
                );
                return conn.end();
            }

            let output = "";

            stream
                .on('close', (code) => {
                    conn.end();
                    if (code === 0) {
                        bot.editMessageText(
                            `âœ… *Password VPS berhasil diubah!*\n` +
                            `â€¢ IP: \`${ip}\`\n` +
                            `â€¢ Password Baru: \`${newPw}\``,
                            { chat_id: chatId, message_id: waitMsg.message_id, parse_mode: "Markdown" }
                        );
                    } else {
                        bot.editMessageText(
                            `âš ï¸ Proses selesai (exit code: ${code}). Cek manual di VPS.`,
                            { chat_id: chatId, message_id: waitMsg.message_id }
                        );
                    }
                })
                .on('data', d => output += d)
                .stderr.on('data', d => output += d);
        });
    })

    .on('error', (err) => {
        bot.editMessageText(
            `âŒ *Failed Change Password*\nâž¡ï¸ VPS tidak bisa diakses.`,
            { chat_id: chatId, message_id: waitMsg.message_id, parse_mode: "Markdown" }
        );
    })

    .connect(connOpt);
});

