bot.on("message", async (msg) => {
  if (!msg.from) return;

  const afkData = loadAfk();
  const userId = msg.from.id;

  // Jika user sedang AFK dan kirim pesan apapun
  if (afkData[userId] && !msg.text?.startsWith("/afk")) {
    const afkInfo = afkData[userId];
    const duration = formatDuration(Date.now() - afkInfo.time);

    delete afkData[userId];
    saveAfk(afkData);

    bot.sendMessage(
      msg.chat.id,
      `ðŸ‘‹ Hai @${msg.from.username || msg.from.first_name}, kamu telah kembali aktif!\n\n` +
      `ðŸ•’ *Durasi AFK:* ${duration}\n` +
      `ðŸ“Œ *Alasan sebelumnya:* ${afkInfo.reason}`,
      {
        parse_mode: "Markdown",
        reply_to_message_id: msg.message_id
      }
    );
  }
});

