bot.onText(/\/totalgrup/i, async (msg) => {
  const chatId = msg.chat.id;

  try {
    const fs = require("fs");
    const path = "./idgrup.json"; // path file JSON grup

    if (!fs.existsSync(path)) {
      return bot.sendMessage(chatId, "âŒ Data grup belum tersedia.");
    }

    const data = JSON.parse(fs.readFileSync(path, "utf-8"));

    const total = Array.isArray(data) ? data.length : Object.keys(data).length;

    let listGrup = "";
    if (Array.isArray(data)) {
      listGrup = data.map((g, i) => `${i + 1}. ${g}`).join("\n");
    } else {
      listGrup = Object.keys(data).map((k, i) => `${i + 1}. ${k}`).join("\n");
    }

    const message = `
ðŸ“Š *Total Grup Terdaftar:* ${total}

ðŸ“ *Daftar Grup ID:*
${listGrup}
    `.trim();

    await bot.sendMessage(chatId, message, { parse_mode: "Markdown" });

  } catch (err) {
    console.error("[TOTALGRUP ERROR]", err);
    await bot.sendMessage(chatId, "âŒ Terjadi kesalahan saat membaca data grup.");
  }
});

