// â”€â”€â”€ GPT AI Command â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€â”€
bot.onText(/^\/(chatgpt|gemini|kimi) (.+)/i, async (msg, match) => {
  const chatId = msg.chat.id;
  const engine = match[1].toLowerCase(); // chatgpt / gemini / kimi
  const question = match[2]; // teks setelah perintah

  if (!question) {
    return bot.sendMessage(chatId, `â“ Silakan ketik pertanyaan setelah perintah /${engine}\nContoh:\n/${engine} Halo AI!`);
  }

  const waitMsg = await bot.sendMessage(chatId, 'ðŸ¤” Sedang mikir...');

  try {
    // function lokal untuk fetch jawaban
    const fetchAnswer = async (engine, question) => {
      const url = `https://joozxdev.my.id/api/${engine}`;
      const res = await fetch(url, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ message: question })
      });
      const data = await res.json();
      let answer = data?.candidates?.[0]?.content?.parts?.[0]?.text || 'âŒ Gagal mendapatkan jawaban.';
      if (answer.length > 4000) answer = answer.slice(0, 3990) + '... (terpotong)';
      return answer;
    };

    // function lokal escape MarkdownV2
    const escapeMd = (str) => str.replace(/([_*[\]()~`>#+\-=|{}.!\\])/g, '\\$1');

    const answer = await fetchAnswer(engine, question);

    await bot.sendMessage(chatId, escapeMd(answer), { parse_mode: 'MarkdownV2' });
    await bot.deleteMessage(chatId, waitMsg.message_id);

  } catch (err) {
    console.error('GPT AI Error:', err);
    await bot.sendMessage(chatId, `âš ï¸ Terjadi kesalahan saat menghubungi API GPT: ${err.message}`);
  }
});

