// ============================= âš™ï¸ DOMAIN MANAGEMENT saurus OFFICIAL V4 (FINAL FIX RESPONSIF) ============================= //
const dns = require("dns");

const pathSub = "./lib/Subdomain.js";

// ============================= ðŸ“¦ AMBIL DAFTAR DOMAIN ============================= //
function getDomainList() {
  if (!fs.existsSync(pathSub)) return [];

  const file = fs.readFileSync(pathSub, "utf8");

  const regex =
    /"([^"]+)":\s*{\s*zone:\s*"([^"]+)",\s*apitoken:\s*"([^"]+)"\s*}/g;

  const domains = [];
  let match;

  while ((match = regex.exec(file)) !== null) {
    domains.push({
      domain: match[1],
      zone: match[2],
      apitoken: match[3],
    });
  }

  return domains;
}

// ========================= ðŸ” CEK STATUS DOMAIN (CLOUDFLARE API TEST + CACHE) ========================= //
async function checkDomainStatus(domain, zone, apitoken) {
  const now = Date.now();

  if (
    domainStatusCache[domain] &&
    now - domainStatusCache[domain].timestamp < cacheTTL
  ) {
    return domainStatusCache[domain].status;
  }

  let statusEmoji = "ðŸ”´ Mati";
  const dummy = `check-${Math.random().toString(36).slice(2)}.${domain}`;

  try {
    const res = await axios.post(
      `https://api.cloudflare.com/client/v4/zones/${zone}/dns_records`,
      {
        type: "A",
        name: dummy,
        content: "1.1.1.1",
        ttl: 120,
        proxied: false,
      },
      {
        headers: {
          Authorization: `Bearer ${apitoken}`,
          "Content-Type": "application/json",
        },
      }
    );

    if (res.data && res.data.success) {
      const id = res.data.result.id;

      await axios.delete(
        `https://api.cloudflare.com/client/v4/zones/${zone}/dns_records/${id}`,
        {
          headers: { Authorization: `Bearer ${apitoken}` },
        }
      );

      statusEmoji = "ðŸŸ¢ Aktif";
    }
  } catch (err) {
    const msg =
      err?.response?.data?.errors?.[0]?.message || "";

    if (
      msg.includes("already exists") ||
      msg.includes("Invalid name")
    ) {
      statusEmoji = "ðŸŸ¢ Aktif";
    }
  }

  domainStatusCache[domain] = {
    status: statusEmoji,
    timestamp: now,
  };

  return statusEmoji;
}

// ========================= ðŸ§© PAGINATION GENERATOR ========================= //
async function generateDomainPage(page = 1) {
  const domains = getDomainList();
  const perPage = 10;

  const totalPages = Math.max(
    1,
    Math.ceil(domains.length / perPage)
  );

  page = Math.max(1, Math.min(page, totalPages));

  const start = (page - 1) * perPage;
  const end = start + perPage;
  const pageDomains = domains.slice(start, end);

  const cachedStatuses = pageDomains.map(
    (d) => domainStatusCache[d.domain]?.status || "â³ Mengecek..."
  );

  let teks = `ðŸŒ *DAFTAR DOMAIN TERSIMPAN*\n\n`;

  pageDomains.forEach((d, i) => {
    teks +=
      `*${start + i + 1}.* ${cachedStatuses[i]} \`${d.domain}\`\n` +
      `â”œ Zone: \`${d.zone}\`\n` +
      `â”” Token: \`${d.apitoken}\`\n\n`;
  });

  teks +=
    `ðŸ“„ *Halaman:* ${page}/${totalPages}\n` +
    `ðŸ“¦ *Total Domain:* ${domains.length}\n\n` +
    `Gunakan perintah:\n` +
    `\`/deldomain <nomor>\``;

  const buttons = [];
  if (page > 1)
    buttons.push({
      text: "â¬…ï¸ Prev",
      callback_data: `domainpage_${page - 1}`,
    });

  if (page < totalPages)
    buttons.push({
      text: "Next âž¡ï¸",
      callback_data: `domainpage_${page + 1}`,
    });

  // UPDATE STATUS BACKGROUND (TANPA GANGGU UI)
  (async () => {
    try {
      await Promise.all(
        pageDomains.map((d) =>
          checkDomainStatus(d.domain, d.zone, d.apitoken)
        )
      );
    } catch {}
  })();

  return { teks, buttons, page, totalPages };
}

