bot.onText(/\/deldomain(?:\s+(.+))?$/, async (msg, match) => {
  const chatId = msg.chat.id;
  const userId = msg.from.id;
  const fs = require("fs");
  const path = "./lib/Subdomain.js";

  // âŒ BUKAN OWNER
  if (!await isOwner(bot, msg)) return

  // ambil daftar domain
  const domains = getDomainList();
  if (!domains.length) {
    return bot.sendMessage(chatId, "âš ï¸ Tidak ada domain terdaftar.");
  }

  // jika tidak ada argumen â†’ tampilkan list
  if (!match[1]) {
    let teks = `ðŸ—‘ï¸ *HAPUS DOMAIN*\n\nGunakan format:\n\`/deldomain <nomor>\`\n\nðŸ“œ *Daftar Domain:*\n\n`;
    domains.forEach((d, i) => {
      teks += `*${i + 1}.* ${d.domain}\n`;
    });
    return bot.sendMessage(chatId, teks, { parse_mode: "Markdown" });
  }

  const index = parseInt(match[1]) - 1;
  if (isNaN(index) || index < 0 || index >= domains.length) {
    return bot.sendMessage(chatId, "âš ï¸ Nomor domain tidak valid.");
  }

  const deletedDomain = domains[index].domain;

  try {
    delete require.cache[require.resolve(path)];
    const data = require(path);

    delete data.domains[deletedDomain];

    const formatted = Object.entries(data.domains)
      .map(([d, v]) =>
        `    "${d}": {\n      zone: "${v.zone}",\n      apitoken: "${v.apitoken}"\n    }`
      )
      .join(",\n");

    const newContent =
`module.exports = {
  domains: {
${formatted}
  }
};`;

    fs.writeFileSync(path, newContent, "utf8");

    return bot.sendMessage(
      chatId,
      `âœ… Domain \`${deletedDomain}\` berhasil dihapus.`,
      { parse_mode: "Markdown" }
    );

  } catch (err) {
    console.error("âŒ Error deldomain:", err);
    return bot.sendMessage(chatId, "âŒ Gagal menghapus domain:\n" + err.message);
  }
});

