// ===================== FORMAT HOST|IP =====================
bot.onText(/^([a-zA-Z0-9-_.]+)\|([0-9.]+)$/i, async (msg, match) => {
  const chatId = msg.chat.id;
  const userId = msg.from.id;

  if (!pendingD1.hasOwnProperty(userId)) return;

  const hostname = match[1];
  const ip = match[2];

  delete pendingD1[userId];

  const instruksi = msgIdInstruction[userId];
  if (instruksi) {
    try { await bot.deleteMessage(instruksi.chatId, instruksi.messageId); } catch {}
    delete msgIdInstruction[userId];
  }

  try { await bot.deleteMessage(chatId, msg.message_id); } catch {}

  pendingD1[userId] = { hostname, ip };

  const keyboard = [];

  for (const domainName of Object.keys(domains)) {
    const { zone, apitoken } = domains[domainName];
    let statusEmoji = "ðŸ”´";
    const now = Date.now();

    const cached = domainStatusCache[domainName];
    if (cached && now - cached.timestamp < cacheTTL) {
      statusEmoji = cached.status;
    } else {
      try {
        const dummy = `test-${Math.random().toString(36).slice(2)}.${domainName}`;
        const res = await axios.post(
          `https://api.cloudflare.com/client/v4/zones/${zone}/dns_records`,
          { type: "A", name: dummy, content: "1.1.1.1", ttl: 120, proxied: false },
          { headers: { Authorization: `Bearer ${apitoken}` } }
        );

        if (res.data.success) {
          await axios.delete(
            `https://api.cloudflare.com/client/v4/zones/${zone}/dns_records/${res.data.result.id}`,
            { headers: { Authorization: `Bearer ${apitoken}` } }
          );
          statusEmoji = "ðŸ”µ";
        }
      } catch (e) {
        const msgErr = e.response?.data?.errors?.[0]?.message || "";
        if (msgErr.includes("already exists")) statusEmoji = "ðŸ”µ";
      }

      domainStatusCache[domainName] = { status: statusEmoji, timestamp: now };
    }

    keyboard.push([
      {
        text: `${statusEmoji} ${domainName}`,
        callback_data: `d1pick:${domainName}:${userId}`
      }
    ]);
  }

  return bot.sendMessage(
    chatId,
`ðŸ“¡ *Pilih domain aktif*
ðŸŒ Host : \`${hostname}\`
ðŸ“¥ IP   : \`${ip}\`

ðŸ”µ Aktif
ðŸ”´ Tidak Aktif`,
    {
      parse_mode: "Markdown",
      reply_markup: { inline_keyboard: keyboard }
    }
  );
});

