bot.onText(/^\/svapido(\d+)\s+(.+)$/i, async (msg, match) => {
    const chatId = msg.chat.id;
    const userId = msg.from.id.toString();
    const nomor = parseInt(match[1]);
    const apikey = match[2].trim();

    if (String(userId) !== String(config.OWNER_ID)) {
        return bot.sendMessage(chatId, "ðŸš« Hanya owner yang bisa pakai perintah ini!");
    }

    if (isNaN(nomor) || nomor < 1 || nomor > 50) {
        return bot.sendMessage(chatId, "âš ï¸ Nomor harus 1â€“50!\nContoh: /svapido50 dop_xxxxx");
    }

    const filePath = "./config.js";
    let fileData = fs.readFileSync(filePath, "utf8");

    const regex = new RegExp(`ApiDO${nomor}:\\s*"([^"]*)"`, "g");
    fileData = fileData.replace(regex, `ApiDO${nomor}: "${apikey}"`);
    fs.writeFileSync(filePath, fileData);

    // Reload config
    delete require.cache[require.resolve("./config.js")];
    global.config = require("./config.js");

    // Update global variable
    global.apiDigitalOcean = global.apiDigitalOcean || {};
    global.apiDigitalOcean[`akun${nomor}`] = apikey;

    bot.sendMessage(
        chatId,
        `âœ… *API DigitalOcean berhasil disimpan!*\n` +
        `â€¢ Slot: *ApiDO${nomor}*\n` +
        `â€¢ Key: \`${apikey}\`\n\n` +
        `ðŸ”„ *config.js berhasil direload otomatis*`,
        { parse_mode: "Markdown" }
    );
});

