bot.onText(/^\/(delapido|delsvapido)(?:\s+v?([\d,]+))?$/i, async (msg, match) => {
    const chatId = msg.chat.id;
    const userId = msg.from.id.toString();

    if (!await isOwner(bot, msg)) return

    if (!match[2]) {
        return bot.sendMessage(chatId,
            `ðŸ§© *Tutorial Hapus API DigitalOcean*\n\n` +
            `Gunakan perintah untuk menghapus slot ApiDO1â€“50.\n` +
            `Contoh:\n` +
            `/delapido 5\n` +
            `/delapido 5,6,7\n` +
            `/delapido v10,11,12\n` +
            `/delsvapido 1,3,9\n\n` +
            `âš¡ Setelah dihapus: config.js direload otomatis, bot update langsung.`, 
            { parse_mode: "Markdown" }
        );
    }

    // Parse nomor
    let nomorList = match[2].split(",").map(n => parseInt(n.trim())).filter(n => !isNaN(n));
    if (nomorList.length === 0) return bot.sendMessage(chatId, "âš ï¸ Format tidak valid!");

    const invalid = nomorList.filter(n => n < 1 || n > 50);
    if (invalid.length > 0) return bot.sendMessage(chatId, `âš ï¸ Nomor invalid: ${invalid.join(", ")} (harus 1â€“50)`);

    const filePath = "./config.js";
    let fileData = fs.readFileSync(filePath, "utf8");

    let deletedSlots = [];
    let notFound = [];

    nomorList.forEach(nomor => {
        const regex = new RegExp(`ApiDO${nomor}:\\s*"([^"]*)"`, "g");
        if (!regex.test(fileData)) notFound.push(nomor);
        else {
            fileData = fileData.replace(regex, `ApiDO${nomor}: ""`);
            deletedSlots.push(nomor);
            if (global.apiDigitalOcean) global.apiDigitalOcean[`akun${nomor}`] = "";
        }
    });

    fs.writeFileSync(filePath, fileData);

    delete require.cache[require.resolve("./config.js")];
    global.config = require("./config.js");

    let text = `ðŸ—‘ï¸ *Hapus API DigitalOcean*\n\n`;
    if (deletedSlots.length > 0) text += `âœ”ï¸ Slot dihapus: ${deletedSlots.map(a => `ApiDO${a}`).join(", ")}\n`;
    if (notFound.length > 0) text += `âŒ Tidak ditemukan: ${notFound.map(a => `ApiDO${a}`).join(", ")}\n`;
    text += `\nðŸ”„ config.js direload otomatis.\nâš¡ Bot update tanpa restart.`;

    bot.sendMessage(chatId, text, { parse_mode: "Markdown" });
});

