bot.onText(/^\/deldroplet(?:\s+(.+))?$/i, async (msg, match) => {
    const chatId = msg.chat.id;
    const userId = msg.from.id.toString();
    const dropletId = match[1] ? match[1].trim() : null;
    if (!await isOwner(bot, msg)) return
    if (!dropletId) return bot.sendMessage(chatId, "âš ï¸ Contoh:\n/deldroplet 123456789");

    let foundDroplet = null;
    let foundAkun = null;
    bot.sendMessage(chatId, "ðŸ” *Mencari VPS...*", { parse_mode: "Markdown" });

    for (let i = 1; i <= 50; i++) {
        const apiKey = global.apiDigitalOcean[`ApiDO${i}`];
        if (!apiKey || apiKey.length < 64) continue;

        try {
            const res = await fetch("https://api.digitalocean.com/v2/droplets", { headers: { Authorization: `Bearer ${apiKey}` } });
            if (!res.ok) continue;

            const droplet = (await res.json()).droplets.find(x => x.id.toString() === dropletId);
            if (droplet) { foundDroplet = droplet; foundAkun = i; break; }
        } catch {}
    }

    if (!foundDroplet) return bot.sendMessage(chatId, "âŒ VPS tidak ditemukan di semua akun.");

    const ip = foundDroplet.networks.v4.find(n => n.type === "public")?.ip_address || "Tidak ada";
    const text =
        `ðŸ—‘ *HAPUS VPS?*\n\nðŸ†” *ID:* ${foundDroplet.id}\nðŸ’½ *Hostname:* ${foundDroplet.name}\nðŸŒ *IP:* ${ip}\nðŸ§© *Spec:* ${foundDroplet.memory}MB | ${foundDroplet.vcpus}vCPU | ${foundDroplet.disk}GB\nðŸŒ *Akun DO:* V${foundAkun}\n\nâš ï¸ *Aksi ini tidak bisa dibatalkan!*`;

    bot.sendMessage(chatId, text, {
        parse_mode: "Markdown",
        reply_markup: {
            inline_keyboard: [
                [{ text: "âœ… Lanjutkan", callback_data: `delvps_yes:${foundAkun}:${foundDroplet.id}` }],
                [{ text: "âŒ Batalkan", callback_data: "delvps_no" }]
            ]
        }
    });
});

