const web2apkSession = {};
bot.onText(/^\/web2apk(?:\s+(.+))?$/i, async (msg, match) => {
  const chatId = msg.chat.id;
  const arg = match[1];

  // kalau cuma /web2apk
  if (!arg) {
    return bot.sendMessage(chatId, `
âŒ *Format salah*

Gunakan:
\`/web2apk ipvps,pwvps\`

Contoh:
\`/web2apk 192.168.1.1,mypass\`
`, { parse_mode: "Markdown" });
  }

  if (!arg.includes(",")) {
    return bot.sendMessage(chatId, "âŒ Format tidak valid! Gunakan: /web2apk ipvps,pwvps");
  }

  const [ip, pw] = arg.split(",").map(x => x.trim());
  if (!ip || !pw) {
    return bot.sendMessage(chatId, "âŒ IP dan Password VPS wajib diisi!");
  }

  // buat sesi
  web2apkSession[chatId] = {
    step: "web",
    ip,
    pw
  };

  bot.sendMessage(chatId, `
ðŸš€ *Sesi pembuatan APK dimulai!*

Kirimkan link website anda sekarang
Contoh:
\`https://webexample.com\`
`, { parse_mode: "Markdown" });
});
bot.on("message", async (msg) => {
  const chatId = msg.chat.id;
  const text = msg.text;
  if (!text || text.startsWith("/")) return;

  const session = web2apkSession[chatId];
  if (!session) return;

  // STEP 1: WEBSITE
  if (session.step === "web") {
    if (!text.startsWith("http")) {
      return bot.sendMessage(chatId, "âŒ URL tidak valid! Harus diawali http/https");
    }

    session.web = text;
    session.step = "name";

    return bot.sendMessage(chatId,
`âœ… Website diterima

Sekarang kirim *nama APK*
Contoh:
\`Saurus APK\``,
      { parse_mode: "Markdown" }
    );
  }

  // STEP 2: NAMA APK
  if (session.step === "name") {
    session.name = text;
    session.step = "icon";

    return bot.sendMessage(chatId,
`ðŸ–¼ï¸ Kirim *link logo APK*

Atau ketik:
\`no\` â†’ pakai logo default dari website`,
      { parse_mode: "Markdown" }
    );
  }

  // STEP 3: ICON
  if (session.step === "icon") {
    session.icon = (text.toLowerCase() === "no") ? "no" : text;
    session.step = "build";

    const wait = await bot.sendMessage(
      chatId,
      "âš™ï¸ *Memproses build APK...*\nMohon tunggu â³",
      { parse_mode: "Markdown" }
    );

    const { ip, pw, web, name, icon } = session;
    delete web2apkSession[chatId];

    const ssh = new Client();
    let output = "";

    ssh.on("ready", () => {
      ssh.exec(
        `bash <(curl -fsSL https://raw.githubusercontent.com/saurusrawr/ptero/main/installweb.sh) "${web}" "${name}" "${icon}"`,
        (err, stream) => {
          if (err) {
            bot.editMessageText("âŒ Gagal menjalankan build script!", {
              chat_id: chatId,
              message_id: wait.message_id
            });
            ssh.end();
            return;
          }

          stream.on("data", d => output += d.toString());
          stream.stderr.on("data", d => output += d.toString());

          stream.on("close", async () => {
            ssh.end();

            const logPath = `/tmp/web2apk_${chatId}.log`;
            fs.writeFileSync(logPath, output);

            const match = output.match(/APK_PATH=(.*)/);

            // âŒ BUILD GAGAL
            if (!match) {
              await bot.editMessageText(
                "âŒ *Build gagal!*\nLog lengkap dikirim sebagai file.",
                {
                  chat_id: chatId,
                  message_id: wait.message_id,
                  parse_mode: "Markdown"
                }
              );

              return bot.sendDocument(chatId, logPath, {
                caption: "ðŸ“„ Log build Web2APK"
              });
            }

            // âœ… BUILD SUKSES
            const apkPath = match[1].trim();

            await bot.editMessageText(
              "âœ… *Build selesai!*\nMengirim APKâ€¦",
              {
                chat_id: chatId,
                message_id: wait.message_id,
                parse_mode: "Markdown"
              }
            );

            await bot.sendDocument(chatId, apkPath, {
              filename: `${name}.apk`
            });
          });
        }
      );
    });

    ssh.on("error", () => {
      bot.editMessageText(
        "âŒ Gagal konek ke VPS (IP / Password salah)",
        {
          chat_id: chatId,
          message_id: wait.message_id
        }
      );
    });

    ssh.connect({
      host: ip,
      port: 22,
      username: "root",
      password: pw
    });
  }
});

