bot.onText(/\/bypass (.+)/, async (msg, match) => {
  const chatId = msg.chat.id;
  const inputUrl = match[1];

  if (!inputUrl) {
    return bot.sendMessage(chatId, 'âŒ Contoh:\n/bypass https://sfl.gl/xxxxx');
  }

  const URL = inputUrl.startsWith('http') ? inputUrl : 'https://' + inputUrl;

  await bot.sendMessage(chatId, 'â³ Bypass dimulai, mohon tunggu...');

  let browser;
  let finalUrl = null;

  try {
    browser = await chromium.launch({
      headless: true,
      args: ['--disable-blink-features=AutomationControlled']
    });

    const context = await browser.newContext({
      viewport: { width: 1280, height: 800 }
    });

    const page = await context.newPage();

    // Tutup popup window baru
    context.on('page', async (p) => {
      await sleep(200);
      await p.close().catch(() => {});
    });

    // Adblock ringan
    const adPatterns = [
      /doubleclick/, /googlesyndication/, /adservice/,
      /facebook\.com\/tr/, /analytics/, /tracking/
    ];

    await page.route('**/*', route => {
      const url = route.request().url();
      if (adPatterns.some(r => r.test(url))) route.abort();
      else route.continue();
    });

    await page.goto(URL, { waitUntil: 'domcontentloaded', timeout: 60000 });

    page.on('framenavigated', () => {
      const u = page.url();
      if (u.includes('sfl.gl/ready/go') && u.includes('t=')) {
        finalUrl = u;
      }
    });

    // klik tombol-tombol umum sfl
    const selectors = [
      '#submit-button',
      '#btn-2',
      '#btn-3',
      '#verify > a',
      '#verify > button'
    ];

    for (let i = 0; i < 20 && !finalUrl; i++) {
      for (const s of selectors) {
        try {
          const el = await page.$(s);
          if (el && await el.isVisible()) {
            await el.click({ delay: 50 });
          }
        } catch {}
      }
      await sleep(1000);
    }

    if (!finalUrl) {
      throw new Error('Link akhir tidak ditemukan');
    }

    await browser.close();

    // === KIRIM KE TELEGRAM + BUTTON ===
    await bot.sendMessage(chatId,
      `âœ… *Bypass Berhasil!*\n\nKlik tombol di bawah:`,
      {
        parse_mode: 'Markdown',
        reply_markup: {
          inline_keyboard: [[
            { text: 'ðŸ”— Kunjungi Link', url: finalUrl }
          ]]
        }
      }
    );

  } catch (e) {
    if (browser) await browser.close().catch(() => {});
    await bot.sendMessage(chatId, `âŒ Gagal bypass\n${e.message}`);
  }
});
