bot.on("callback_query", async (cb) => {
  if (!cb.data.startsWith("req_")) return;

  if (!OWNER_FILE.includes(cb.from.id)) {
    return bot.answerCallbackQuery(cb.id, {
      text: "âŒ Kamu bukan owner",
      show_alert: true
    });
  }

  const [action, targetId] = cb.data.split(":");

  // === TERIMA ===
  if (action === "req_accept") {
    await bot.sendMessage(targetId, `
<b>âœ… REQUEST DITERIMA</b>

Owner setuju dengan request kamu.
â³ Dalam <b>1â€“7 hari</b> ke depan kemungkinan akan dikerjakan.
`, { parse_mode: "HTML" });

    await bot.editMessageReplyMarkup({ inline_keyboard: [] }, {
      chat_id: cb.message.chat.id,
      message_id: cb.message.message_id
    });

    return bot.answerCallbackQuery(cb.id, { text: "Request diterima" });
  }

  // === TOLAK ===
  if (action === "req_reject") {
    pendingReject.set(cb.from.id, targetId);

    await bot.sendMessage(cb.from.id, `
âŒ <b>Kirim alasan penolakan</b>
Silakan ketik alasannya sekarang.
`, { parse_mode: "HTML" });

    return bot.answerCallbackQuery(cb.id);
  }

  // === PIKIR ===
  if (action === "req_think") {
    await bot.sendMessage(targetId, `
<b>ðŸ¤” REQUEST DIPERTIMBANGKAN</b>

Owner sedang memikirkan request kamu.
`, { parse_mode: "HTML" });

    await bot.answerCallbackQuery(cb.id, {
      text: "Status: Dipikirkan"
    });
  }
});
